// Example of a base64-encoded image (shortened for brevity)
const certificateImageBase64 = 'data:image/png;base64,'  // Your full Base64 string here

function generateCertificate() {
    const name = document.getElementById('full-name').value.trim();
    
    if (!name) {
        alert('Please enter a valid name.');
        return;
    }

    // Set the name text on the certificate preview
    const nameElement = document.getElementById('name');
    nameElement.textContent = name;

    // Show the download button
    const downloadLink = document.getElementById('downloadLink');
    downloadLink.style.display = 'inline-block';

    // When the user clicks the download button, generate the PDF
    downloadLink.addEventListener('click', function() {
        const { jsPDF } = window.jspdf;
        const doc = new jsPDF('landscape', 'mm', 'a4');  // portrait, A4 size

        // Create a new Image object for the certificate template (Base64 encoded)
        const certificateImage = new Image();
        certificateImage.src = certificateImageBase64;  // Use the Base64 string

        certificateImage.onload = function() {
            // Get the dimensions of the image for scaling
            const imgWidth = 297;  // Width for A4 in mm (portrait)
            const imgHeight = 210; // Height for A4 in mm (portrait)

            // Draw the background image to the PDF
            doc.addImage(certificateImage, 'PNG', 0, 0, imgWidth, imgHeight); // Full size of the page

            // Add the name text on top of the certificate
            doc.setFont('helvetica', 'bold');
            doc.setFontSize(22);
            doc.setTextColor(0, 34, 102); // Blue color
            doc.text(name, imgWidth / 2, 97, { align: 'center' }); // Adjust Y position as needed
            
            // Save the PDF
            doc.save('certificate.pdf');
        };

        certificateImage.onerror = function() {
            alert('Failed to load certificate image.');
        };
    });
}

